#define DEBUG

void show_list(int **envelopes, int envelopesSize) {
    if (envelopesSize > 30) {
        return ;
    }
    for (int i = 0; i < envelopesSize; i++) {
        printf("[%d %d]\n", envelopes[i][0], envelopes[i][1]);
    }
    printf("----------\n");
}

int compare(const void *a, const void *b) {
    int **nodeA = (int **)a;
    int **nodeB = (int **)b;
    
    int w = ((*nodeA)[0] - (*nodeB)[0]);
    int h = ((*nodeA)[1] - (*nodeB)[1]);

    if (w == 0) {
        return h;
    }
    return w;
}

int maxEnvelopes(int** envelopes, int envelopesSize, int* envelopesColSize) {
    if (envelopesSize == 0) {
        return 0;
    }
    qsort(envelopes, envelopesSize, sizeof(int) * 2, compare);
    #ifdef DEBUG
    show_list(envelopes, envelopesSize);
    #endif
    int max = 0;
    int *dp = (int *) malloc(sizeof(int) * envelopesSize);
    int prev_i = 0;
    
    for (int i = 0; i < envelopesSize; i++) {
        dp[i] = 1;
        for (int j = prev_i; j < i; j++) {
            if (envelopes[i][0] > envelopes[j][0] && envelopes[i][1] > envelopes[j][1]) {
                
                if (dp[i] < (dp[j] + 1)) {
                    dp[i] = dp[j] + 1;
                    if (dp[j] > dp[prev_i]) {
                        prev_i = j;
                    }
                    
                }
                
            }
        }
        max = max >= dp[i] ? max : dp[i];
    }
    free(dp);
    return max;
}

